export const typeOfHouse = value => {
  return {
    type: "TYPE_OF_HOUSE",
    payload: value
  };
};

export const newGame = values => {
  return {
    type: "NEW_GAME",
    payload: values
  };
};

export const btnPlay = playerResults => {
  return {
    type: "BTN_PLAY",
    payload: playerResults
  };
};

